                        <html><head><meta charset="utf-8"></head><body>
<p>Удобный ленточный поводок-рулетка предназначен для выгула собак весом до 12 кг. Лента поводка автоматически сматывается и поводок в процессе использования не провисает, не касается грунта и таким образом не пачкается и не перетирается. Поводок не нужно подбирать руками когда питомец подошел ближе, таким образом ваши руки всегда чистые.</p>
<p>Система сматывания длины &mdash; дополнительное удобство, помогающее контролировать поведение животного. Корпус рулетки выполнен из ударопрочного пластика.</p>
<p>Рулетка очень легка в применении, принесет вам еще большую радость от моментов, проведенных с любимцем.</p>
